import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

// Типы данных (пример)
interface Competition {
  id: number;
  name: string;
  date: string;
  location: string;
}

interface Gymnast {
  id: number;
  name: string;
  birth_year: number;
  club: string;
}

const CompetitionDetails: React.FC = () => {
  const { id } = useParams();             // ID соревнования из URL
  const [competition, setCompetition] = useState<Competition | null>(null);
  const [gymnasts, setGymnasts] = useState<Gymnast[]>([]);
  const [loading, setLoading] = useState<boolean>(true);

  useEffect(() => {
    if (id) {
      // Загружаем детальную информацию о соревновании
      fetchCompetitionDetails(id);
      // Загружаем список гимнасток для данного соревнования
      fetchGymnasts(id);
    }
  }, [id]);

  // Получение детальной информации о соревновании
  const fetchCompetitionDetails = async (competitionId: string) => {
    try {
      // Допустим, у вас есть эндпоинт:
      // GET /competitions/:id
      // Который возвращает JSON объекта соревнования
      const response = await axios.get<Competition>(
        `http://localhost:8080/competitions/${competitionId}`
      );
      setCompetition(response.data);
    } catch (error) {
      console.error("Ошибка при получении информации о соревновании:", error);
    }
  };

  // Получение списка гимнасток
  const fetchGymnasts = async (competitionId: string) => {
    try {
      // По заданию: GET /competitions/:id/list
      // Который возвращает [{id, name, birth_year, club}, ...]
      const response = await axios.get<Gymnast[]>(
        `http://localhost:8080/competitions/${competitionId}/list`
      );
      setGymnasts(response.data);
    } catch (error) {
      console.error("Ошибка при получении списка гимнасток:", error);
    } finally {
      setLoading(false);
    }
  };

  // Обработчик клика на кнопку "Судить"
  const handleJudge = () => {
    // Здесь вы можете сделать любой переход, или логику судейства
    // Например, перейти на страницу судейства:
    // navigate(`/competitions/${id}/judge`);
    // Или просто вывести в консоль:
    console.log("Нажата кнопка 'Судить' для соревнования с ID =", id);
  };

  if (loading) {
    return <p>Загрузка данных...</p>;
  }

  if (!competition) {
    return <p>Соревнование не найдено</p>;
  }

  return (
    <div>
      <h2>Детальная информация о соревновании</h2>
      <p><strong>ID:</strong> {competition.id}</p>
      <p><strong>Название:</strong> {competition.name}</p>
      <p><strong>Дата:</strong> {competition.date}</p>
      <p><strong>Место:</strong> {competition.location}</p>

      {/* Одна кнопка "Судить" */}
      <button onClick={handleJudge}>Судить</button>

      <h3>Список гимнасток:</h3>
      {gymnasts.length === 0 ? (
        <p>Нет доступных гимнасток для этого соревнования</p>
      ) : (
        <table border={1} cellPadding={5} style={{ borderCollapse: 'collapse' }}>
          <thead>
            <tr>
              <th>ID</th>
              <th>Имя</th>
              <th>Год рождения</th>
              <th>Клуб</th>
            </tr>
          </thead>
          <tbody>
            {gymnasts.map((gymnast) => (
              <tr key={gymnast.id}>
                <td>{gymnast.id}</td>
                <td>{gymnast.name}</td>
                <td>{gymnast.birth_year}</td>
                <td>{gymnast.club}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default CompetitionDetails;
